import React from 'react';
import classes from './cartcontent.module.css';
import Card from '../Card/Card';
function CartContent(props){
return (
    <Card>
    <div className={classes.main}>
        <h2>{props.name}</h2>
        <p>{props.price}</p>
        <span>{props.amount}</span>
    </div>
    </Card>
)
}

export default CartContent;
